import { AnyObject, ConnectType } from '../types';
export default function mixinLifetimes(type: ConnectType, options: AnyObject, load: () => void, unload: () => void): {
    onLoad: (this: Record<string, any>, query: any) => void;
    onUnload: (this: Record<string, any>) => void;
} | {
    attached: (this: Record<string, any>) => void;
    detached: (this: Record<string, any>) => void;
    lifetimes: any;
};
